import React, { useRef, useState, useContext, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCloudUploadAlt } from "@fortawesome/free-solid-svg-icons";
import "../styles/upload-tourguide.css";

import { useNavigate } from "react-router-dom";
import { AuthContext } from "./../context/AuthContext";
import { BASE_URL } from "./../utils/config";

const UploadTourguide = () => {
  const fileInputRef = useRef(null);
  const [selectedFileName, setSelectedFileName] = useState("");

  const [tourData, setTourdata] = useState({});

  const { dispatch } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    setSelectedFileName(file.name);
  };

  const handleChange = (e) => {
    setTourdata((prev) => ({ ...prev, [e.target.id]: e.target.value }));
    console.log(e.target.id);
  };

  const handleClick = async (e) => {
    e.preventDefault();
    console.log(JSON.stringify(tourData));
    try {
      const res = await fetch(`${BASE_URL}/tourguide`, {
        method: "post",
        headers: {
          "content-type": "application/json",
        },
        body: JSON.stringify(tourData),
      });

      const result = await res.json();

      if (!res.ok) alert(result.message);

      dispatch({ type: "LOGIN_SUCCESS" });
      navigate("/tours");
    } catch (err) {
      alert(err.message);
    }
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="/">
          Navbar
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link" href="/">
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/about">
                About
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/contact">
                Contact
              </a>
            </li>
          </ul>
        </div>
      </nav>
      <div className="body">
        <h3 className="Judul__TourGuide">
          Ayo Daftarkan Home Stay Anda <br />
          untuk menjadi bagian dari TOUR'U
        </h3>
        <form
          action=""
          className="d-flex flex-column justify-content-center items-center gap-5"
        >
          <div className="d-flex justify-content-center gap-5">
            <div className="form-kiri">
              <input
                className="form-control form-control-lg"
                type="text"
                placeholder="Nama Homestay"
              />
              <input
                className="form-control form-control-lg"
                type="text"
                placeholder="Lokasi"
              />
              <input
                className="form-control form-control-lg"
                type="text"
                placeholder="Harga/Hari"
              />
              <input
                className="form-control form-control-lg"
                type="text"
                placeholder="Deskripsi"
              />
            </div>
            <label className="upload-label" htmlFor="formFileLg">
              <span>{selectedFileName || "Upload Foto Homestay"}</span>
              <FontAwesomeIcon
                icon={faCloudUploadAlt}
                className="upload-icon"
              />
              <input
                ref={fileInputRef}
                className="form-control form-control-lg"
                type="file"
                id="formFileLg"
                accept="image/pdf*"
                onChange={handleFileChange}
              />
            </label>
          </div>
          <div className="m-auto d-flex gap-3">
            <button className="button-submit m-auto rounded-pill">
              Submit
            </button>
            <a className="cancel m-auto rounded-pill" href="/tours">
              Cancel
            </a>
          </div>
        </form>
      </div>
    </div>
  );
};

export default UploadTourguide;
